import React, { useState } from "react";

function List({ contacts }) {
  const [filter, setFilter] = useState("");

  return (
    <div>
      <input placeholder="Filter Contacts" />
      <ul>
        {contacts.map((contacts, index) => {
          return (
            <div
              style={{
                marginRight: 20,
                marginTop: 10,
              }}
            >
              <li key={index}>
                {contacts.fullName} - {contacts.phone}
              </li>
            </div>
          );
        })}
      </ul>
    </div>
  );
}

export default List;
